import Vue from 'vue';
import LineChart from '../Charts/LineChart.vue';
import PhanTichTongQuan from "@/components/Analytics/Overview/PhanTichTongQuan.vue";
import OverviewSourced from './OverviewSourced.vue';

export default Vue.extend({
    name: "ReportOverview",
    props: {
        time_range: {
            type: Object,
            default: null,
        }
    },
    components: {
        PhanTichTongQuan,
        OverviewSourced,
    },
});
